function sendInfo(bs,p1,p2) {
  pos=0;
  len=200;
  while (pos<bs.length) {
    if (pos+len>bs.length) len=bs.length-pos;
    b=bs.bytes(pos,len);
    print("Attempting to set part: "+b);
    ins=0x20;
    if (pos==0) ins=0x21;
    resp=card.sendApdu(0x80,ins,p1,p2,b,0x00);
    res="FAILURE!!!";
    if (card.SW.toString(16)=="9000") res="Success!";
    print("Result of setting that part: "+res);
    pos+=len;
  }
}

cert=new ByteString("",HEX)
print("Sending certificate...");
sendInfo(cert,0x01,0x00);

